import './TandC.css'
import Sidebar from './Sidebar'
import { useState, useEffect } from 'react'

function TandC(){
  const [isFormEnabled, setFormEnabled] = useState(false);
  useEffect(()=>{
    const enableForm = () => {
      setFormEnabled(true);
    };
    enableForm()
  },[isFormEnabled]);
  return (
    <div id='main'><Sidebar />
      <div id='TandC'>
        <h4>Terms and Conditions</h4>
          <form className='TandC'>
            <textarea rows={22} cols={80} disabled={isFormEnabled}></textarea>
            <button type='submit'>Send</button>
            <button onClick={()=>{setFormEnabled(false)}}>Edit</button>
          </form>
      </div>
    </div>
  )
}

export default TandC
